import React from 'react';
import './MovieCard.css';

export const MovieCard = ({movie}) => {
    return (
        <div className="card">
            <img src={movie.image} alt={movie.name} />
            <div>
                <h2>{movie.name}</h2>
                <h4>{movie.language}</h4>
                <h4>{movie.premiered}</h4>
            </div>
        </div>
    )
}
